import React from 'react';
import PropType from 'prop-types';
import { CardDeck, Card, Col } from 'react-bootstrap';


const CardList = ({
    pokemons,
    // srcImage,
}) => (
  <CardDeck>
    {
      pokemons.map(pokemon => (
        <Col key={pokemon.name} sm="2">
          <Card>
            <Card.Img variant="top"  src={pokemon.sprites.front_default}/>
              <Card.Body>
                <Card.Title className="text-center" >{pokemon.name}</Card.Title>
                <Card.Text>{pokemon}</Card.Text>
              </Card.Body>
            <Card.Footer>
              <small className="text-muted">Last updated 3 mins ago</small>
            </Card.Footer>
          </Card>
        </Col>
      )) 
    }
  </CardDeck>
);

CardList.propTypes = {
  pokemons: PropType.array,
  // title: PropType.string,
  // description: PropType.string,
  // srcImage: PropType.string,
};

export default CardList;
